        line-height: 22px;
        margin: 5px 0 30px;
        font-size: 16px;
        font-style: italic;
      }
    }
    .about-right-two {
      height: 600px;
      min-height: 600px;
      background-image: url(../images/about-right.jpeg);
      background-position: 50% 50%;
      background-size: cover;
      height: 600px;
      padding: 0 100px;
    }
    .about-span-two {
      grid-column: 1 / span 2;
      display: flex;
      width: 100%;
      justify-content: space-evenly;
      align-items: center;
      padding: 50px 20px;
      height: 200px;
      .item {
        padding: 0 20px;
        float: left;
        line-height: 10px;
      }
      h2 {
        font-size: 42px;
      }
      h5 {
        font-size: 16px;
        font-style: italic;
      }
    }
  }

  // Services section

  .services-section {
    text-align: center;
    .two-grid {
      display: grid;
      grid-template-columns: 1fr 1fr;
      gap: 20px;
      padding: 0 20px;
      .services-left {
        background-image: url(../images/services-left.jpeg);
        height: 600px;
        min-height: 600px;
        background-size: cover;
        background-position: 50% 50%;
      }
      .services-right {
        background-color: whitesmoke;
        display: flex;
        align-items: center;
        justify-content: center;
        flex-direction: column;
        text-align: center;
        line-height: 20px;
        min-height: 600px;
        height: 600px;
        padding: 0 100px;
        h2 {
          margin: 5px auto;
          font-size: 42px;
          line-height: 40px;
        }
        h5 {
          line-height: 22px;
          margin: 5px 0 30px;
          font-size: 16px;
          font-style: italic;
        }
      }
    }
    .three-grid {
      display: grid;
      grid-template-columns: 1fr 1fr 1fr;
      gap: 20px;
      padding: 0 20px;
      padding-top: 20px;
      .services-item {
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        height: 400px;
        min-height: 400px;
        padding: 40px 50px 0;
        background-color: whitesmoke;
        &:first-child:hover {
          background-color: #e3e1d3;
          transition: all 0.75s ease;
          background-size: auto;
        }
        &:nth-child(2):hover {
          background-color: #e0cece;
          transition: all 0.75s ease;
          background-size: auto;
        }
        &:last-child:hover {
          background-color: #d1d7e0;
          transition: all 0.75s ease;
          background-size: auto;
        }
        img {
          height: 125px;
          width: 125px;
          align-self: center;
        }
        h2 {
          font-size: 42px;
          font-weight: 700px;
        }
      }
    }
  }

  // Quotes section

  .quotes-section {
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    padding: 100px 20px;
    h2 {
      margin: 5px 0;
      letter-spacing: -3px;
      line-height: 40px;
    }
    p {
      font-size: 20px;
    }
  }

  // Portfolio section

  .portfolio-section {
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    grid-template-rows: 1fr 1fr;
    gap: 20px;
    padding: 100px 20px;
    .portfolio-text {
      margin: 1px;
    }
    a {
      background-position: center;
      background-size: cover;
      width: 100%;
      height: 100%;
      text-decoration: none;
      display: flex;
      align-items: center;
      justify-content: center;
    }
    .pf1 {
      background-image: url(../images/portfolio1.jpg);
    }
    .pf2 {
      background-image: url(../images/portfolio2.jpg);
    }
    .pf3 {
      background-image: url(../images/portfolio3.jpg);
    }
    .pf4 {
      background-image: url(../images/portfolio4.jpg);
    }
    .pf5 {
      background-image: url(../images/portfolio5.jpg);
    }
    .pf6 {
      background-image: url(../images/portfolio6.jpg);
    }
    .pf7 {
      background-image: url(../images/portfolio7.jpg);
    }
    .outer-div {
      display: none;
      width: 100%;
      height: 100%;
      border: 1px solid green;
      display: flex;
      align-items: center;
      justify-content: center;
      padding: 20px;
      transition: all 0.5s ease;
      aspect-ratio: 1 / 1;
      .inner-div {
        height: 100%;
        width: 100%;
        display: flex;
        justify-content: center;
        align-items: center;
        span {
          line-height: 22px;
          letter-spacing: -0.5px;
          display: none;
          text-align: center;
        }
      }
      &:hover {
        background-color: rgba($color: #000000, $alpha: 0.8);
        display: block;
        .inner-div {
          border: 1px solid white;
          span {
            display: block;
          }
        }
      }
    }
  }

  // Contact section

  .contact-section {
    padding: 100px 20px;
    width: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    text-align: center;
    .contact-div {
      width: 50%;
      display: flex;
      flex-direction: column;
      form {
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
        label {
          text-transform: uppercase;
          display: block;
          width: 100%;
          font-weight: bold;
          margin: 5px auto;
          letter-spacing: -1px;
          line-height: 20px;
        }
        input {
          width: 100%;
          height: 2.5rem;
          margin-bottom: 10px;
          line-height: 1.6;
          vertical-align: middle;
          border: 1px solid #ccc;
        }
        textarea {
          display: block;
          width: 100%;
          border: 1px solid #ccc;
          height: auto;
          color: #555;
          background-color: #fff;
          overflow: auto;
        }
        .button {
          width: 20%;
          margin: 20px auto;
          text-align: center;
          padding: 0;
          border: 2px solid black;
        }
      }
    }
  }

  // Footer

  .footer-section {
    background-color: #242424;
    margin: 10px;
    padding: 20px;
    height: 300px;
    .footer-div {
      width: 100%;
      display: grid;
      grid-template-columns: repeat(4, 1fr);
      color: white;
      h6 {
        color: #7d7d7d;
        font-size: 14px;
        text-transform: uppercase;
        line-height: 18px;
        letter-spacing: 0;
      }
      .col-1 {
        grid-column: 1;
        img {
          height: 15%;
          width: 15%;
          aspect-ratio: 1 / 1;
          margin-top: 3.5rem;
          margin-left: 3.5rem;
        }
      }
      .col-2 {
        grid-column: 2;
        display: flex;
        flex-direction: column;

        a {
          text-decoration: none;
          color: white;
          cursor: pointer;
          font-size: 15px;
          font-family: $ff-p;
          margin-bottom: 5px;
          letter-spacing: -0.5px;
          line-height: 28px;
        }
      }
      .col-3 {
        p {
          font-size: 15px;
          line-height: 28px;
          letter-spacing: -0.5px;
          font-weight: 400;
          margin-bottom: 5px;
        }
      }
      .col-4 {
        p {
          font-size: 15px;
          line-height: 28px;
          letter-spacing: -0.5px;
          font-weight: 400;
          margin-bottom: 5px;
        }
      }
    }
  }
}
